class Prices extends React.Component {
    state = {
        currency: 'USD'
    }

    render() {

        console.log(this.props.data);

        return (
            <div>
                <ul className="list-group">
                    {this.props.data.map(country => (
                        <>
                            <p>{country.common_name}</p>
                            <p>{country.latin_name}</p>
                            <p>{country.sun ? "Planteras i solen" : "Planteras i skugga"}</p>
                            <hr />
                        </>
                    ))}
                </ul>
                <br />
            </div>
        );
    }
}

export default Prices;
